values:
i&nbsp;really have been neglecting this&nbsp;thing. i don't mean to but i'm so busy with slacking&nbsp;off and procrastinating, that i just can't keep&nbsp;up with it. i haven't even&nbsp;come up with that many new&nbsp;death plots for lexi.&nbsp;&nbsp;

this weekend basically sucked. i ran, worked, slept, and worked.&nbsp; but! i got a $90 tip which is really cool.&nbsp;

lexi called me today:&nbsp;
lexi: mhepphemarghherr&nbsp;
me: what do you want?
lexi: i don't know
me: i'm going to kill you.
that's how it went for the&nbsp;most part.&nbsp;that's how it always goes. 

&nbsp;

i didn't really&nbsp;do too much today. i took my permit test,&nbsp;but i failed it. that was to be expected though. i haven't looked at the book since august. i went to the mall tonight with dana and kim. i got one of the early november cds. the bookstore didn't have the book i need for my research project. so&nbsp;lame.&nbsp;i could've gone to ivy hall tonight. but my cousins didn't go because i don't know why.

&nbsp;one of my cousins' friend's dad died in a car crash last night. it's so sad and kind of scary too. things like that really show you how short life is and how everything can change so quickly.&nbsp;

on a lighter note, kelly's coming home in four days.&nbsp;that should be fun. sleepovers, movies, hot chocolate. can't wait.&nbsp;and christmas in a little over a week. i should probably get some presents and such.&nbsp;

i haven't really done much homework/laundry yet and i think we're going to philly tomorrow. i should probably stop procrastinating.

&nbsp;ridley won. tonight wasn't bad. the night went surprisingly quickly while i working in the snackbar. we went over lexi's afterwards. she forced me to watch&nbsp;a stupid guiness book of world records show. i think i'll&nbsp;get the lady with the longest fingernails to stab her. or maybe i'll buy her a yak so it can eat her.&nbsp;i just downloaded some more&nbsp;saves the day. and the early november. and eminem because bill told me to. and elliott smith's girlfriend definitely killed him.&nbsp; 

we don't have any orange juice. i need some. now. i'll probably end up walking to wawa tomorrow to get some.&nbsp; 

i'm kind of tired. i guess i'll go to bed now.
